import { React } from "react";
import { NavLink } from "react-router-dom";
import Logo from "../../img/logo.svg";
const NavBar = () => {
  return (
    <>
      <section>
        <div className="row">
          <div className="col-6">
            <NavLink exact to="/">
              <img className="logo" src={Logo} alt="logo" />
            </NavLink>
          </div>
          <div className="col-6">
            <ul className="navbar-nav">
              <li className="nav-item ">
                <NavLink exact className="nav-link my_btn2" to="/">
                  home
                </NavLink>
              </li>
              <li className="nav-item active">
                <NavLink exact className="nav-link my_btn" to="/project">
                  project
                </NavLink>
              </li>
            </ul>
          </div>
        </div>
      </section>
    </>
  );
};
export default NavBar;
